import React from 'react';
import styled from 'styled-components';
import { H6, H1, H2, H4 } from 'components/Typography';
import Container from 'components/Container';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const Content = styled.div`
    color: ${props => props.theme.colors.white};
    background-color: ${props => props.theme.colors.primary};
    width: 100%;
    height: 400px;
    font-family: 'Raleway', sans-serif;

    @media (max-width: ${props => props.theme.screenSize.tablet}) {
       height: 600px;

    }
`;

const TextContainer = styled.div`
    padding: 10px;
    text-align: center;
    padding-bottom: 40px;
    @media (max-width: ${props => props.theme.screenSize.tablet}) {
        text-align: center;
        transform: translate(0%, 0%);
        height: 100%;
        padding: 10px;
    }
`;

const Logo = styled(H6) `
    text-align: center;
    `;

const SiteBottom = styled.div`
    min-width: 100%;
    height: 40px;
    margin-top: calc(100% - 40px)
    z-index: 1000;
    position: absolute;
    background-color: ${props => props.theme.colors.darkPrimary}
`;


const Section = () =>
    <div>
        <Content>
            <Container>
                    <TextContainer >
                        <H2 light bold>Ota yhteyttä niin suunnitellaan yhdessä verkkosivuprojektisi!</H2>
                        <H4 bold light>	<FontAwesomeIcon icon="envelope" /> info@webin.fi</H4>
                        <H4 bold light><FontAwesomeIcon icon="phone" /> +358442360403</H4>

                    </TextContainer>
            </Container>
        </Content>
    </div>;

export default Section;
